local function cleanUID(str)
    return string.match(str, "%d+")
end

local function randomFromList(list)
    if not list or #list == 0 then return nil end
    return cleanUID(list[math.random(1, #list)])
end

local function collectFromList(list)
    local result = {}
    for _, v in ipairs(list) do
        local uid = cleanUID(v)
        if uid then
            table.insert(result, uid)
        end
    end
    return result
end

function UIDModule:GetUIDs(params)
    params = params or {}

    local mode = params.mode or "all"
    local listName = params.list or "default"

    if mode == "random" and listName == "random" then
        local keys = {}
        for k in pairs(Lists) do table.insert(keys, k) end
        local pickedList = Lists[keys[math.random(1, #keys)]]
        return randomFromList(pickedList)
    end

    local targetList = Lists[listName] or Lists.default

    if mode == "random" then
        return randomFromList(targetList)
    end

    return collectFromList(targetList)
end

